import './App.css';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Login from '../src/components/login/Login';
import Signup from '../src/components/login/Signup';
import Home from '../src/components/event/Home';
import Deneme from '../src/components/profile/Deneme';

//<Route exact path='/home/:userId' Component={Home}></Route>
function App() {
  return (
    <div className="App">
          <BrowserRouter>
            <Routes>
              <Route exact path='/login' Component={Login}></Route>
              <Route exact path='/signup' Component={Signup}></Route>
              <Route exact path='/deneme' element={<div className="event-page"><Deneme /></div>} />   
              <Route exact path='/home/:userId' element={<div className="home-page"><Home /></div>} />             

            </Routes>
          </BrowserRouter>
    </div>
  );
}

export default App;
